import React from 'react';
import { View,Text, TextInput, Button,StyleSheet } from 'react-native';
import Logo from "../../assets/images/logo.jpg";

function SignIn(props) {
    return (
        <div>
          <View style={styles.container}>
                <Text><img className={styles.img} scr={Logo} /><h3></h3> Signup</Text>
               <form>
                <View>
                    <Text id="Email" name="Email"><h3>Email</h3></Text>
                    <TextInput for="#Email"></TextInput>
                </View>
                <br/>
                <View>
                    <Text id="Email" name="Email"><h3>Password</h3></Text>
                    <TextInput for="#Email"></TextInput>
                </View>
                <br/>
                <Button type="submit" title="SIGN IN"> </Button>

                </form>
            </View>
            
            
        </div>
    );
}

export default SignIn;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    img:{
        height:'40px',
        width:'40px'
    }
  });
